import React from "react";
import "../team/Team.css";
import teamBackground from "../images/teamBackground.png";
const Team = () => {
  return (
    <div className="teamMain">
      <div className="teamHeader">
        <h3>TEAM</h3>
        {/* <img className="teambackgroundImage" src={teamBackground} /> */}
      </div>
    </div>
  );
};

export default Team;
